import ExpenseItem from './ExpenseItem'
import '../../UI/Items.css'
import Card from './Card'
import ExpensesFilter from './ExpensesFilter';

function Items(props) {
    return (
      <div>
        <ExpensesFilter />
        <Card className='expenses'>
      <h2>Let's get started!</h2>
      <ExpenseItem title={props.expenses[0].title} price={props.expenses[0].amount} date={props.expenses[0].date}></ExpenseItem>
      <ExpenseItem title={props.expenses[1].title} price={props.expenses[1].amount} date={props.expenses[1].date}></ExpenseItem>
      <ExpenseItem title={props.expenses[2].title} price={props.expenses[2].amount} date={props.expenses[2].date}></ExpenseItem>
      <ExpenseItem title={props.expenses[3].title} price={props.expenses[3].amount} date={props.expenses[3].date}></ExpenseItem>
    </Card>
    </div>
    )
}
export default Items;
